import React, { useState } from 'react';
import { Form, Input, Button, TreeSelect } from 'antd';

const { TreeNode } = TreeSelect;

const layout = {
  labelCol: { span: 8 },
  wrapperCol: { span: 16 },
};
const tailLayout = {
  wrapperCol: { offset: 8, span: 16 },
};

const Join = () => {
  const [selectValue, setSelectValue] = useState('');
  const onFinish = (values) => {
    console.log('Success:', values);
  };

  const onFinishFailed = (errorInfo) => {
    console.log('Failed:', errorInfo);
  };

  const onChange = (value) => {
    console.log(value);
    setSelectValue(value);
  };

  return (
    <div style={{ backgroundColor: '#272727', height: '800px' }}>
      <div style={{ backgroundColor: 'white', width: '400px', height: '500px', position: 'absolute', top: '20%', left: '38%', padding: '10px' }}>
        <Form {...layout} name="join" initialValues={{ remember: true }} onFinish={onFinish} onFinishFailed={onFinishFailed}>
          <Form.Item label="Username" name="username" rules={[{ required: true, message: 'Please input your username!' }]}>
            <Input />
          </Form.Item>
          <Form.Item label="Password" name="password" rules={[{ required: true, message: 'Please input your password!' }]}>
            <Input.Password />
          </Form.Item>
          <Form.Item label="Select">
            <TreeSelect
              showSearch
              style={{ width: '100%' }}
              value={selectValue}
              dropdownStyle={{ maxHeight: 400, overflow: 'auto' }}
              placeholder="Please select"
              allowClear
              treeDefaultExpandAll
              onChange={onChange}
            >
              <TreeNode value="software" title="소프트웨어대학">
                <TreeNode value="computer" title="소프트웨어학부" />
                <TreeNode value="ict" title="ICT융합학부" />
              </TreeNode>
              <TreeNode value="engineering" title="공과대학">
                <TreeNode value="건축학부" title={<b style={{ color: '#08c' }}>건축학부</b>} />
                <TreeNode value="건설환경공학과" title={<b style={{ color: '#08c' }}>건설환경공학과</b>} />
                <TreeNode value="교통·물류공학과" title={<b style={{ color: '#08c' }}>교통·물류공학과</b>} />
                <TreeNode value="전자공학부" title={<b style={{ color: '#08c' }}>전자공학부</b>} />
                <TreeNode value="재료화학공학과" title={<b style={{ color: '#08c' }}>재료화학공학과</b>} />
                <TreeNode value="기계공학과" title={<b style={{ color: '#08c' }}>기계공학과</b>} />
                <TreeNode value="산업경영공학과" title={<b style={{ color: '#08c' }}>산업경영공학과</b>} />
                <TreeNode value="생명나노공학과" title={<b style={{ color: '#08c' }}>생명나노공학과</b>} />
                <TreeNode value="로봇공학과" title={<b style={{ color: '#08c' }}>로봇공학과</b>} />
                <TreeNode value="융합공학과" title={<b style={{ color: '#08c' }}>융합공학과</b>} />
                <TreeNode value="국방정보공학과" title={<b style={{ color: '#08c' }}>국방정보공학과</b>} />
                <TreeNode value="스마트융합공학부" title={<b style={{ color: '#08c' }}>스마트융합공학부</b>} />
              </TreeNode>
              <TreeNode value="science" title="과학기술융합대학">
                <TreeNode value="sss" title={<b style={{ color: '#08c' }}>sss</b>} />
              </TreeNode>
              <TreeNode value="economic" title="경상대학">
                <TreeNode value="sss2" title={<b style={{ color: '#08c' }}>sss</b>} />
              </TreeNode>
              <TreeNode value="media" title="언론정보대학">
                <TreeNode value="sss3" title={<b style={{ color: '#08c' }}>sss</b>} />
              </TreeNode>
              <TreeNode value="design" title="디자인대학">
                <TreeNode value="sss4" title={<b style={{ color: '#08c' }}>sss</b>} />
              </TreeNode>
              <TreeNode value="sport" title="예체능대학">
                <TreeNode value="sss5" title={<b style={{ color: '#08c' }}>sss</b>} />
              </TreeNode>
              <TreeNode value="culture" title="국제문화대학">
                <TreeNode value="sss6" title={<b style={{ color: '#08c' }}>sss</b>} />
              </TreeNode>
              <TreeNode value="pharmacy" title="약학대학">
                <TreeNode value="sss7" title={<b style={{ color: '#08c' }}>sss</b>} />
              </TreeNode>

            </TreeSelect>
          </Form.Item>
          <Form.Item {...tailLayout}>
            <Button type="primary" htmlType="submit">
              가입하기
            </Button>
          </Form.Item>
        </Form>
      </div>
    </div>
  );
};

